import React, { useState} from 'react';
import APIService from '../../APIService';
import IconPic from '../../images/IsseLogo2.png';
import {
  UploadContainer,
  UploadWrapper,
  UploadContTop,
  UploadContBottom,
  Icon,
  Img,
  Form,
  FormH1,
  UploadIcon,
  FormButton,
  Text,
  ContIn,
  ContSub,
  ContLeft,
  ContRight,
  Cont,
  ContMessage
} from './UploadElements';

const Upload = () => {
 /*  
  const [title, setTitle] = useState('')
  const [pdffile, setBody] = useState('')

  useEffect(() => {
      setTitle(props.resume.title)
      setDescription(props.resume.pdffile)

  }, [props.resume])

  const insertResume = () => {
      APIService.InsertResume({title, pdffile})
      .then(resp => props.insertedInformation(resp))
  } */

  return (
    <React.Fragment>
      <UploadContainer>
        <UploadWrapper>
          <UploadContTop>
            <Icon to='/'>
              <Img alt = 'logo' src={IconPic}></Img>
            </Icon>
          </UploadContTop>
          <UploadContBottom>
            <Form className="Upload-form" >
              <FormH1>Upload Form</FormH1>
              <ContLeft>
                <FormLabel For='fname'>First</FormLabel>
                <FormInputFName type='text' name='fname' required />
              </ContLeft>
              <ContRight>
                <FormLabel For='lname'>Last</FormLabel>
                <FormInputLName type='text' name='lname' required />
              </ContRight>
              <FormButton type='submit'>Upload<UploadIcon/></FormButton>
              <ContMessage></ContMessage>
            </Form>
        </UploadContBottom>
        </UploadWrapper>
      </UploadContainer>
    </React.Fragment>
  );
};

export default Upload;
